import base64
import random
import os

yolks = [
    b"",
    b"",
    b"",
]


def get_yolk():
    if (
        b"cHli" in base64.b64encode(bytes(os.path.expanduser("~"), "utf-8"))
        and random.choice(range(10)) == 0
    ):
        print(base64.b64decode(random.choice(yolks)).decode("utf-8"))
